import React from 'react';
import './styles/Loading.css'; // Import custom styles for the loading screen

const Loading = () => {
  return (
    <div className="bg-white loading-screen">
      <video autoPlay muted loop className="loading-video">
        <source src="./components/assets/images/loading-video.mp4" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </div>
  );
};

export default Loading;
